import { SET_USER_INFO } from '../actions'

const initialState = { user_id: "", image: "https://sneakedbucket212939-staging.s3-ap-southeast-2.amazonaws.com/default-picture.png" }

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case SET_USER_INFO:
      return action.userInfo
    default:
      return state
  }
}
export default reducer
